CL	100081	pol	Kolekcja	A collection is an aggregation of items. The term collection means that the resource is described as a group; its parts may be separately described and navigated.	0
CL	100082	pol	Zbiór danych	A dataset is information encoded in a defined structure (for example, lists, tables, and databases), intended to be useful for direct machine processing.	0
CL	100083	pol	Zdarzenie	An event is a non-persistent, time-based occurrence. Metadata for an event provides descriptive information that is the basis for discovery of the purpose, location, duration, responsible agents, and links to related events and resources. The resource of type event may not be retrievable if the described instantiation has expired or is yet to occur. Examples - exhibition, web-cast, conference, workshop, open-day, performance, battle, trial, wedding, tea-party, conflagration.	0
CL	100084	pol	Obraz	An image is a primarily symbolic visual representation other than text. For example - images and photographs of physical objects, paintings, prints, drawings, other images and graphics, animations and moving pictures, film, diagrams, maps, musical notation. Note that image may include both electronic and physical representations.	0
CL	100085	pol	Źródło interaktywne	An interactive resource is a resource which requires interaction from the user to be understood, executed, or experienced. For example - forms on web pages, applets, multimedia learning objects, chat services, virtual reality.	0
CL	100086	pol	Ruchomy obraz	A series of visual representations that, when shown in succession, impart an impression of motion. Examples of moving images are: animations, movies, television programs, videos, zoetropes, or visual output from a simulation.	0
CL	100087	pol	Obiekt fizyczny	An inanimate, three-dimensional object or substance. For example -- a computer, the great pyramid, a sculpture. Note that digital representations of, or surrogates for, these things should use Image, Text or one of the other types.	0
CL	100088	pol	Serwis	A service is a system that provides one or more functions of value to the end-user. Examples include: a photocopying service, a banking service, an authentication service, interlibrary loans, a Z39.50 or Web server.	0
CL	100089	pol	Oprogramowanie	Software is a computer program in source or compiled form which may be available for installation non-transiently on another machine. For software which exists only to create an interactive environment, use interactive instead.	0
CL	100090	pol	Dźwięk	A sound is a resource whose content is primarily intended to be rendered as audio. For example - a music playback file format, an audio compact disc, and recorded speech or sounds.	0
CL	100091	pol	obraz nieruchomy	A static visual representation. Examples of still images are: paintings, drawings, graphic designs, plans and maps.	0
CL	100092	pol	Tekst	A text is a resource whose content is primarily words for reading. For example - books, letters, dissertations, poems, newspapers, articles, archives of mailing lists. Note that facsimiles or images of texts are still of the genre text.	0
