CL	100081	ita	collezione	"Una collezione è un aggregato di indicazioni. Il termine collezione significa che la risorsa è descritta da un gruppo; questa parte può essere descritta e visualizzata in modo separato."	0
CL	100082	ita	dato  	Un dato è l'informazione codificata in una struttura definita (per esempio, liste, tabelle e database), utilizzabile attraverso processamenti diretti della macchina.	0
CL	100083	ita	evento	Un evento è una ricorrenza non persistente basata sul tempo. Il metadato fornisce per un evento le informazioni descrittive che sono di base per la ricerca di scopi, località, durate, elementi responsabili e link ad eventi e risorse rilevanti. La risorsa di un certo evento può essere ritirata se le informazioni descrittive sono scadute nel tempo o nell’effetto. Esempi – esibizione, conferenza web, workshop, giorno di apertura, capacità d’esecuzione, battaglia, prova, matrimonio, caffè-the, confederazione.	0
CL	100084	ita	immagine	Un'immagine è una rappresentazione primitiva e simbolica di visualizzazione oltre al testo. Per esempio - immagini e fotografie di oggetti fisici, dipinti, stampe, disegni, altre immagini e grafici, animazioni e cartoni animati, film, diagrammi, mappe, note musicali. Nota che l'immagine può prevedere sia la rappresentazione d'elettronica che fisica.	0
CL	100085	ita	risorsa interattiva	Una risorsa interattiva è una risorsa la quale richiede l'interazione con l'utente per comprendere, eseguire o sperimentare. Per esempio - le pagine web, applicazioni, oggetti a spiegazione multi-mediale, servizi di Chat, realtà virtuali.	0
CL	100086	ita	Serie di immagini	Una serie di rappresentazioni visuali che quando mostrate in successione diffondono un emozione. Esempi di immagini in movimento sono: animazioni, film, programmi televisivi, video, zoetropes o esternazioni di simulazioni visuali.	0
CL	100087	ita	Oggetto fisico	Un oggetto o sostanza inanimata tridimensionale. Per esempio - un computer, una grande piramide, una scultura. Nota che la rappresentazione digitale o un suo surrogato dovrà utilizzare un'immagine, testo o un altro di supporto	0
CL	100088	ita	Servizio	Un servizio è un sistema che fornisce uno o più funzioni di valori all'utilizzatore. Esempi comprendono: un servizio di fotocopie, un servizio bancario, un servizio di autentica, una consultazione inter-bibliotecaria, un servizio Z39.50 o un servizio web. 	0
CL	100089	ita	Programma	Il software un programma di un computer distribuito o compilato che può essere disponibile per installazioni terminali o su una propria macchina.	0
CL	100090	ita	Suono	Un suono è una risorsa il cui contenuto primario è di essere emesso come audio. Per esempio - un file per ascoltare musica, un compact disc audio o suoni e voci registrate.	0
CL	100091	ita	Immagine statica	Una rappresentazione statica visuale. Esempi sono ancora immagini: dipinti, disegni, grafici, piante e mappe.	0
CL	100092	ita	testo	Un testo è una risorsa il cui contenuto primario sono parole da leggere. Per esempio - libri, lettere, relazioni, poemi, giornali, articoli, liste di email archiviate. Nota che immagini o fac-simili di testo sono anch'esse considerate testo.	0
