EL	10003	ita	soggetto	Un argomento del contenuto della risorsa. In genere, il soggetto sarà espresso come parole chiave, frasi chiave, codice di classificazione che descrivono l'argomento della risorsa. Una raccomandazione sull'uso comune è quella di selezionare il termine da un vocabolario registrato o da uno schema formale di classificazione	0
EL	10004	ita	descrizione	Un riconoscimento dei contenuti della risorsa. Esempi di descrizione includono, ma non sono solo questo: un riassunto, una tabella di contenuti, un riferimento ad una rappresentazione grafica dei contenuti o testo libero di descrizione dei contenuti	0
EL	10005	ita	Pubblicatore	Ente responsabile per aver reso disponibile la risorsa. Esempi di pubblicatori includono: una persona, un ente o un servizio. In genere, il nome del pubblicatore dovrebbe essere usato per identificare l'ente.	0
EL	10006	ita	Gestore	Ente responsabile che contribuisce ai mantenimento dei contenuti della risorsa. Esempi di gestori sono: una persona, un ente o un servizio. In genere, il nome del gestore dovrebbe essere l'ente.	0
EL	10007	ita	Data	Data del periodo del ciclo di vita della risorsa. In genere, la data sarà associata con la creazione o la disponibilità della risorsa. Una raccomandazione di uso comune per la codifica dei valori della data è quella definita nel profilo ISO 8601 [W3CDTF] e include (insieme ad altre) le date nel formato AAAA-MM-GG.	0
EL	10008	ita	tipo 	La natura o genere dei contenuti della risorsa. Tipo include termini che descrivono le categorie generali, le funzioni, generazioni o livelli di aggregazione per contenuti. Raccomandazione d'uso comune è di selezionare un valore da un vocabolario registrato (per esempio il vocabolario dei tipi DCMI [DCT1]). Per descrivere le manifestazioni fisiche o digitali della risorsa si usano gli elementi formattati.	0
EL	10009	ita	formato	La manifestazione fisica o digitale della risorsa. In genere, il formato include il tipo di supporto o le dimensioni della risorsa. Il formato può essere usato per identificare il software, hardware o altre strumentazioni necessarie per la visualizzazione o la gestione della risorsa. Esempi di dimensioni comprendono dimensione di spazio e durata. Raccomandazione d'uso comune è di selezionare una valore da un vocabolario registrato (per esempio la lista dei tipi di supporto per internet [MIME] che definiscono i formati supportati dal computer).	0
EL	10010	ita	identificatore	"Un riferimento non-ambiguo alla risorsa in un determinato contesto. Raccomandazione d'uso comune è di identificare la risorsa dal contenuto del testo o dal numero conforme al sistema di identificazione formale. Il sistema di identificazione formale comprende ma non si limita solo a questo la URI (Uniforme Risorsa Identificatore) in cui è compreso anche la URL (Uniforma Risorsa Localizzazione); il DOI (Digitale Oggetto Identificatore) e il ISBN (Numero Standard Internazionale Libri)."	0
EL	10011	ita	sorgente	Riferimento della risorsa dalla quale l'attuale risorsa è stata ottenuta. La presente risorsa può essere derivata totalmente o in parte da una risorsa originaria. Una raccomandazione di buon uso è identificare i riferimenti della risorsa attraverso spiegazioni con testi o numeri conformi al sistema formale di riferimento. 	0
