byla Evropská komise a cílem je sběr, koordinace a zajištění kvalitních informací o životním prostředí a přírodních zdrojích, které jsou srovnatelné v rámci Evropského společenství. Program má několik částí: Land Cover (krajinný pokryv), Biotopes (biotopy) a Air, (ovzduší). V roce 1991 se Evropská komise rozhodla díky programu Phare rozšířit program CORINE i na státy střední a východní Evropy.</gco:CharacterString></gmd:purpose><gmd:pointOfContact><gmd:CI_ResponsibleParty><gmd:organisationName><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">Ministerstvo životního prostředí ČR</gco:CharacterString></gmd:organisationName><gmd:contactInfo><gmd:CI_Contact><gmd:phone><gmd:CI_Telephone/></gmd:phone><gmd:address><gmd:CI_Address><gmd:deliveryPoint><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">Vršovická 65</gco:CharacterString></gmd:deliveryPoint><gmd:city><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">Praha 10</gco:CharacterString></gmd:city><gmd:postalCode><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">100 10</gco:CharacterString></gmd:postalCode><gmd:country><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">Česká republika</gco:CharacterString></gmd:country><gmd:electronicMailAddress><gco:CharacterString xmlns:gco="http://www.isotc211.org/2005/gco">podatelna@env.cz</gco:CharacterString></gmd:electronicMailAddress></gmd:CI_Address></gmd:address><gmd:onlineResource><gmd:CI_OnlineResource><gmd:linkage><gmd:URL>http://www.env.cz</gmd:URL></gmd:linkage></gmd:CI_OnlineResource></gmd:onlineResource></gmd:CI_Contact></gmd:contactInfo><gmd:role><gmd:CI_RoleCode codeListValue="custodian" codeList="./resources/codeList.xml#CI_RoleCode">custodian</gmd:CI_RoleCode></gmd:role></gmd:CI_ResponsibleParty></gmd:pointOfContact><gmd:resourceMaintenance><gmd:MD_MaintenanceInformation><gmd:maintenanceAndUpdateFrequency><gmd:MD_MaintenanceFrequencyCode codeListValue="unknown" codeList="http://standards.i