11	77	Program CORINE (COoRdination of INformation on the Environment) byl zahájen v roce 1985. Iniciátorem byla Evropská komise a cílem je sběr, koordinace a zajištění kvalitních informací o životním prostředí a přírodních zdrojích, které jsou srovnatelné v rámci Evropského společenství. Program má několik částí: Land Cover (krajinný pokryv), Biotopes (biotopy) a Air, (ovzduší). V roce 1991 se Evropská komise rozhodla díky programu Phare rozšířit program CORINE i na státy střední a východní Evropy.	0_0_4751_0_1_0_77_0_	cze	1
